            <tr>
                <th>Id</th>
                <th>Name</th>
                <th>Description</th>
                <th>Photo</th>
                <th>Price</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for product in products %}
            <tr>
                <td>{{ product.id }}</td>
                <td>{{ product.name }}</td>
                <td>{{ product.description }}</td>
                <td>{{ product.photo }}</td>
                <td>{{ product.price }}</td>
                <td>

                    <a  class=\"btn btn-outline-success btn-sm\" href=\"{{ path('app_products_edit', {'id': product.id}) }}\">edit</a>

                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"6\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a class=\"btn btn-outline-success btn-sm\" href=\"{{ path('app_products_new') }}\">Create new</a>
{% endblock %}
